import React, { Component} from 'react';
import './App.css';

class App extends Component {
    endCall(){
        console.log("endCall")
    }
    pauseCall(){
        console.log("pauseCall")
    }

    render() {
        return (
          <div className="App">
              <button onclick = {endCall}>End Call</button>
              <button onclick ={pauseCall}>Pause</button>
          </div>
        );
     }
}

export default App;
